  return (
    <svg className={className} stroke="currentColor" strokeWidth=".5" fill="currentColor" viewBox="0 0 20 20">
      <path d="M1.6 10.1c-.1-.1-.4-.1-.5 0-.2.2-.2.4 0 .5L7.4 17c.2.2.4.2.5 0l11-13.5c.1-.1.1-.4 0-.5-.1-.2-.4-.2-.5 0L7.6 16.3l-6-6.2z"></path>
    </svg>
  )
}
